import React from "react";
import { Container, Form, Input } from "reactstrap";

const Login = () => {
  return;
  <div>
    <Container>
      <Form>
        <Input type="text" name="name" placeholder="name" />
      </Form>
    </Container>
  </div>;
};

export default Login;
